  \"graphic-preview-description\",\n\t\t\"value\": \"This strato volcano with a near
  perfect cone is located in central North Island on the southwest flank of the Tangariro
  massif. It has been New Zealand's most active volcano in historic times, with more
  than 60 eruptive episodes since its first recorded eruption in 1839. This photo
  shows the pyroclastic flow (nuee ardente) and eruption cloud during the January
  1974 eruption. Another eruption occurred in 1977.\"\n\t},\n\t{\n\t\t\"key\": \"frequency-of-update\",\n\t\t\"value\":
